import './widget.scss'
import KeyboardArrowUpOutlinedIcon from '@mui/icons-material/KeyboardArrowUpOutlined';
import PersonOutlineOutlinedIcon from '@mui/icons-material/PersonOutlineOutlined';
import  { MonetizationOnOutlined } from '@mui/icons-material';
import AccountBalanceWalletOutlinedIcon from '@mui/icons-material/AccountBalanceWalletOutlined';
import ShoppingCartCheckoutOutlinedIcon from '@mui/icons-material/ShoppingCartCheckoutOutlined';

const Widget = ({type}) => {
    let data;
    const amount=100;
    const diff=20;

    switch(type){
         case 'user':
            data={
                title:"USERS",
                isMoney:false,
                link:"See all users",
                icon:<PersonOutlineOutlinedIcon className='icon' style={{color:"crimson", backgroundColor:"rgba(255,0,0,0.2)"
                }}/>
            };
            break;

         case 'earning':
            data={
                title:"EARNINGS",
                isMoney:true,
                link:"View net earnings",
                icon:<MonetizationOnOutlined className='icon'style={{
                    backgroundColor:'rgba(0,128,0,0.2)',
                    color:'green',
                }}/>
            };
            break;    
         case 'balance':
            data={
                title:"BALANCE",
                isMoney:true,
                link:"See details",
                icon:<AccountBalanceWalletOutlinedIcon className='icon'style={{
                    backgroundColor:'rgba(128,0,128,0.2)',
                    color:'purple',
                }}/>
            };
            break;
        default:
            break;


    }





  return (
    <div className='widget'>
        <div className="left">
            <span className="title">{data.title}</span>
            <span className="counter">{data.isMoney&&"$"}{amount}</span>
            <span className="link">{data.link}</span>

        </div>

        <div className="right">
            <div className="percentage positive">
                <KeyboardArrowUpOutlinedIcon/>
                {diff}%
            </div>
            {data.icon}
        </div>

    </div>
  )
}

export default Widget
